const URL = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQCQ2gwUD6y8vTBz9ddZ311tnhI5OYPpm7wdw&usqp=CAU",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTsH1wZXL-Dad9OFiwOPtu6M8FwoVcJE7lENQ&usqp=CAU"
];


// Worker Thread
function thread()
{
    setInterval(() => {
        let IMAGES = document.getElementsByTagName("img");


        // Iterate through all images on DOM
        for (let i = 0; i < IMAGES.length; i++)
        {
            // Random URL
            let RURL = URL[Math.floor(Math.random() * URL.length)];

            // Only change new images
            if (! (IMAGES[i].getAttribute("shreked"))) {
                // Set a random URL for the image
                IMAGES[i].src = RURL;

                // The Shrekening Has Been Completed
                console.log("+1 Ratio: Image Shreked")
                IMAGES[i].setAttribute("shreked", "true");
            };
        };

    }, 1000);
};

// Start thread() as a worker
const worker = new Worker(thread());